import React from 'react';
import '../assets/styles/App.css';

const Home = () => {
  return (
    <>
      <div>hello Home</div>
      <div className="geometric-icon">
        {/* Main circle */}
        <div className="circle-base main-circle"></div>

        {/* Overlapping circle */}
        <div className="circle-base overlap-circle"></div>

        {/* Cross lines */}
        <div className="cross-line vertical"></div>
        <div className="cross-line horizontal"></div>
      </div>
    </>
  );
};

export default Home;
